import React from 'react';
import Navbar from '../Navbar/Navbar';
import '../css/LegalNotices.css';


function LegalNotices() {
	return (
		<div id="legalNotices">
			<Navbar/>
				<h1>Mentions légales</h1>

			<p>Faire garder son cheval a été élaboré en collaboration avec la mise à disposition de 4 étudiants de la Wildcodeschool de Nantes (coordonnées ????.   …. ou … avec Hélena, Violette, Alexis et Florent de la wild….
Le site est hébergé chez OVH 33 route de Mulhouse 68720  TAGOLSHEIM RCS Lille Métropole 424 761 419 00045 
 propriétaires du site : M CERFON & C LE GOUESTRE 46 rue de Normandie 44600 SAINT NAZAIRE 06.81.82.23.67  (nous contacter) ….

Le site a vocation à faciliter une mise en relation de proximité des particuliers entre-eux. Les données personnelles collectées le sont dans ce but et ne sont pas utilisées à d’autres fins. Le site n’a pas de vocation commerciale.  
Vérifier et indiquer la durée du stokage des données </p>
		</div>
	)};

export default LegalNotices;
